CREATE TABLE `__MigrationHistory` (`MigrationId` VARCHAR(150) NOT NULL COLLATE 'latin1_general_ci',	`ContextKey` VARCHAR(300) NOT NULL COLLATE 'latin1_general_ci',	`Model` LONGBLOB NOT NULL, `ProductVersion` VARCHAR(32) NOT NULL COLLATE 'latin1_general_ci',	PRIMARY KEY (`MigrationId`, `ContextKey`)) COLLATE='latin1_general_ci' ENGINE=InnoDB auto_increment=0;
create table `EventStream` (`Id` bigint not null  auto_increment ,`AggregateRootId` CHAR(36) BINARY default ''  not null ,`DateCreated` datetime not null ,`SequenceStart` bigint not null ,`SequenceEnd` bigint not null ,`AggregateType` nvarchar(255) ,`EventData` longtext,primary key ( `Id`) ) engine=InnoDb auto_increment=0;
CREATE index  `IdxAggregateRootId` on `EventStream` (`AggregateRootId` DESC) using HASH;
CREATE index  `IdxAggregateType` on `EventStream` (`AggregateType` DESC) using HASH;
CREATE index  `IdxDateCreated` on `EventStream` (`DateCreated` DESC) using HASH;
create table `SnapshotStream` (`Id` bigint not null  auto_increment ,`AggregateRootId` CHAR(36) BINARY default ''  not null ,`DateCreated` datetime not null ,`Version` bigint not null ,`SnapshotType` nvarchar(255) ,`SnapshotData` longtext,primary key ( `Id`) ) engine=InnoDb auto_increment=0;
CREATE index  `IdxAggregateRootId` on `SnapshotStream` (`AggregateRootId` DESC) using HASH;
CREATE index  `IdxSnapshotType` on `SnapshotStream` (`SnapshotType` DESC) using HASH;
CREATE index  `IdxDateCreated` on `SnapshotStream` (`DateCreated` DESC) using HASH;
